import "./Visualizer.css";

const Visualizer = () => {
    return (
        <div>
            <div className="indicator">
                <ul>
                    <li>
                        <div className="source-indicator"></div>
                        Source Node
                    </li>
                    <li>
                        <div className="destination-indicator"></div>
                        Destination Node
                    </li>
                </ul>
            </div>
            <Grid />
        </div>
    );
};

export default Visualizer;
